 insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '얼굴생김새 귀여운 이미지에 오목조목한 인상의 소유<BR>자입니다. 음양오행의 금형(金形)에 속하며 보조개가 <BR>깊게 팬다거나 입술에 주름이 많습니다. <BR><BR>체구는 아담하겠으며 상체는 적당하지만 하체는 약간 <BR>통통한 느낌을 주는 사람이라 볼 수 있겠습니다. <BR><BR>매우 여성적인 인상의 소유자로써 귀엽고 섬세함이 두드러지는 타입입니다.', 'F01', '1');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 토형(土形)에 속하는 타입으로 전반적인 윤곽<BR>은 통통한 귀여운 이미지가 있는 타입입니다.<BR><BR>이목구비는 아기자기한 듯한 느낌을 주며 얼핏 보여 <BR>지는 이미지가 어리광을 부릴 것만 같은 낙천적이면서<BR>도 애교스러운 면을 가진 여성이 되겠습니다. <BR><BR>키는 그리 크지는 않겠으며 약간의 볼륨감이 매력적인<BR>스타일이 되겠습니다. ', 'F02', '2');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '가녀린 이미지에 긴 생머리가 잘 어울리는 적당히 야<BR>윈 여성이겠습니다. <BR><BR>얼굴형은 오행의 수형(水形)에 속하며 다소 서구적인 <BR>스타일로 이목구비는 시원시원한 하지만 입술은 작아<BR>서 여성스러운 느낌이 잘 살아나는 사람입니다.<BR><BR>보통 키에 날씬한 체구가 많아서 하이힐을 신으면 시<BR>각적으로 키가 커 보이는 타입이 되겠습니다. ', 'F03', '3');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '목형(木形)에 속하는 미인입니다. 전반적으로 길고 갸<BR>름한 계란형의 얼굴에 표정이 살아있는 미인형입니다. <BR><BR>화사한 느낌을 주기까지 하는 그녀의 표정은 때에 따<BR>라서는 냉기가 흐르는 사나운 모습을 하는 정도의 변<BR>화를 가지고 있으며 콧날과 얼굴윤곽이 뚜렷한 특징을<BR>가지고 있습니다. ', 'F04', '4');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 얼굴형이 토형(土形)의 기운이 강하므로 <BR>동그란 느낌을 준다고 볼 수 있겠으며 목소리에서 윤<BR>기가 느껴지는 타입의 동양적인 선을 가진 여성입니<BR>다. <BR><BR>눈과 입이 크고 도톰한 느낌이며 안정감 있는 표정과 <BR>차분한 인상의 소유자로써 약간의 살집이 있는 통통한<BR>체형에 활동적인 느낌은 소년 같은 느낌의 보이쉬한 <BR>매력이 있겠습니다. ', 'F05', '5');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '동그란 듯한 인상이 오행의 토형(土形)의 상징이라 볼 <BR>수 있으며 귀여움이&nbsp;매력인 스타일이 되겠습니다. <BR><BR>여성스러운 외모에 적절한 패션 감각으로 젊어 보이거<BR>나 여성으로써 매력적인 여성이라 볼 수 있습니다. <BR><BR>체형은 아기자기할 정도의 작은 키에 일반적인 몸매에<BR>약간의 볼륨감이 살아있는 동양적인 미인형입니다.', 'F06', '6');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 길쭉한 느낌을 주는 목형(木形)의 얼굴형<BR>태에 손가락도 길며 눈매도 잔잔한 편으로 동양적인 <BR>미인에 속합니다. <BR><BR>차분한 듯 하면서도 자상해 보이는 외모에 약간은 키<BR>가 크겠으며 수수한 옷차림을 보아 특별히 외향적이라<BR>볼 수는 없지만 소심하지는 않는 정도의 여성입니다. ', 'F07', '7');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 날렵하고 감각 있게 생긴 얼굴<BR>이기 때문에 오행의 분류상 화형(火形)에 속합니다. <BR><BR>눈은 크고 빛나며 반달모습을 하고 있어서 애교가 엿<BR>보이며 목소리는 의외의 허스키한 면이 있을 수 있겠<BR>습니다. <BR><BR>체형은 작고 아담하지만 가슴이 발달해 의외의 볼륨감<BR>이 느껴지는 스타일입니다. ', 'F08', '8');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 둥근 얼굴형태이기 때문에 토형(土形)<BR>이라 볼 수 있겠습니다. <BR><BR>외관상으로 눈매가 강렬한 인상이며 앙다문 입술이 매<BR>력적이면서 섹시한 사람입니다. <BR><BR>체형은 작고 아담하지만 허리가 가늘며 균형이 잘 잡<BR>혀 있어 패셔너블한 멋쟁이일 확률이 높다고 볼 수 있<BR>겠습니다. ', 'F09', '9');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 오행의 분류는 토형(土形)에 속합니다.<BR><BR>단아한 이미지에 다소 동글동글한 느낌을 주는 인상이<BR>며 이목구비는 뚜렷하고 콧방울이 도톰한 것이 특징이<BR>라 볼 수 있겠습니다. <BR><BR>체형은 다소 글래머러스한 볼륨감 있는 몸매에 아담하<BR>고 약간 작은 키입니다.', 'F10', '10');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 보면 그녀의 얼굴은 둥근 얼굴에 콧방<BR>울도 동그란 편이기 때문에 토형(土形)에 속한다고 볼 <BR>수 있겠습니다. <BR><BR>모난 구석 없이 전체적인 인상이 안정감을 주며 약간<BR>의 살집이 있어 통통한 느낌을 주지만 절대 비만인 스<BR>타일은 아니며 안정된 체격에 볼륨감이 있어 글래머러<BR>스한 타입입니다. ', 'F11', '11');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '음양오행의 분류에 따르면 둥근 원형을 그리는 얼굴형<BR>태로 토형(土形)에 속합니다.<BR><BR>특히 이마가 넓고 이목구비가 아래로 존재하기 때문에<BR>아기 같다거나 귀여운 이미지를 느낄 수 있겠습니다. <BR><BR>몸매는 다소 빈약한 듯하지만 스마트하고 날씬한 체형<BR>입니다.', 'F12', '12');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '화형(火形)에 속하는 얼굴이기 때문에 갸름하고 작은 <BR>얼굴입니다.<BR>&nbsp;<BR>전체적인 느낌이 화사하며 밝은 느낌이며 외관상으로 <BR>눈매가 강렬한 인상이어서 열정적인 느낌이 강하겠습<BR>니다. <BR><BR>또한 동양적인 외모에 피부는 희기 때문에 미인이라 <BR>볼 수 있겠으며 체형은 아담한 편이며 어깨가 좁아 보<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 호본능을 자극하는 스타일입니다. ', 'F13', '13');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 보면 그녀의 얼굴은 목형(木形)에 속합<BR>니다. <BR><BR>첫인상은 크게 매력적이지 않을 수 있겠지만 깊은 눈<BR>매에 길고 오똑한 콧날이 이지적이고 속이 깊어 보이<BR>는 편이라 사람의 관심을 흡수하는 스타일이라 볼 수<BR>있겠습니다. <BR><BR>체형은 다소 큰 키에 어깨가 넓으며 볼륨감이 있어서 <BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 대충 어떤 옷이든 소화하는 사람입니다. ', 'F14', '14');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 보면 그녀의 얼굴은 전형적인 수형(水<BR>形)에 속한다고 볼 수 있겠습니다. <BR><BR>이마가 약간 좁은 반면에 턱이 넓으므로 물방울을 연<BR>상시킵니다.<BR><BR>약간 편안해 보이는 느낌을 전달하며 콧대가 오똑하고<BR>가지런한 치아의 소유자이므로 서구적인 매력이 있겠<BR>습니다. 체형도 큰 키에 글래머에 속합니다. ', 'F15', '15');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 화형(火形)에 속한<BR>다고 볼 수 있겠습니다. <BR><BR>작은 얼굴에 아기자기한 외모의 소유자이겠습니다. 표<BR>정이 풍부하고 아기자기한 면으로 인해 편한 느낌을<BR>주는 여성입니다. <BR><BR>목소리는 앳되고 어려보이는 귀여운 보이스이며 키는 <BR>작고 아담한 체형의 소유자입니다. ', 'F16', '16');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '음양오행의 분류로 보면 그녀의 얼굴은 목형(木形)에 <BR>속하기 때문에 이지적인 느낌을 주는 스타일이라 볼 <BR>수 있겠습니다.<BR>&nbsp;<BR>특히 볼록한 이마와 크고 시원한 눈빛이 매력적이며 <BR>특징입니다.<BR><BR>목형에서는 자주 볼 수 없는 볼륨감이 잘 살아 있는 얼<BR>굴에 몸매역시 이와 같이 늘씬한 체형에 굴곡이 잘 발<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 달되어 있는 여성입니다. ', 'F17', '17');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 날렵하고 감각 있게 생긴 얼굴<BR>형태로 미뤄 화형(火形)에 속합니다. <BR><BR>편안한 인상의 소유자이지만 눈빛이 강렬하고 동양적<BR>인 밋밋하고 매끈한 얼굴이기 때문에 때로는 차갑고 <BR>단호한 느낌을 주기도 하겠습니다.<BR>&nbsp;<BR>왜소한 체격에 아담한 몸매의 소유자라 볼 수 있습니다.', 'F18', '18');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '화형(火形)에 속하는 얼굴이기 때문에 전체적인 느낌<BR>이 화사하며 밝은 느낌이며 외관상으로 눈매가 강렬한<BR>인상이어서 열정적인 느낌을 받습니다. <BR><BR>엄밀히 말하면 목화가 섞여 있어 화사하게 살아나는 <BR>인상에 고운 이목구비가 차분해 보이며 이지적인 분위<BR>기를 발산한다고 볼 수 있겠습니다. <BR><BR>체형은 키가 크며 몸매는 다소 빈약합니다.', 'F19', '19');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적 관점에서 오행의 분류로 보면 그녀의 얼굴은<BR>수형(水形)에 속한다고 볼 수 있겠습니다. <BR><BR>촉촉한 눈매와 큰 입술이 특징이기에 전형적인 수기운<BR>이 강하다고 볼 수 있겠으며 키는 보통이겠으며 몸매<BR>는 볼륨감이 있으나 둔부가 더 발달한 동양적인 미인<BR>입니다.', 'F20', '20');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '음양오행의 분류로 보면 그녀의 얼굴은 금형(金形)에 <BR>가까운 얼굴이라 볼 수 있겠습니다. <BR><BR>얼굴전체의 윤곽이 뚜렷하며 광대가 살아있으며 턱이 <BR>보기 좋게 넓은 것이 특징이라 할 수 있습니다. <BR><BR>키는 보통에 가슴이 약간 발달한 정도의 아담한 체구<BR>이며 단정한 이미지로 정장이 잘 어울리는 타입입니<BR>다.<BR>', 'F21', '21');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 음양오행의 관점에<BR>서 수형(水形)에 속합니다.<BR><BR>통통한 얼굴에 하단부가 잘 발달되어 있고 푸근한 이<BR>미지를 가지고 있기 때문에 첫인상이 안정감이 있으며<BR>세련된 이목구비가 매력적입니다.<BR><BR>보통 키에 볼륨감이 좋은 글래머형 체구에 속한다고 <BR>볼 수 있겠습니다. ', 'F22', '22');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 음양오행에서 금형<BR>(金形)에 속한다고 볼 수 있겠습니다. <BR><BR>이마와 턱이 각지긴 했지만 살집이 있어 날카로워 보<BR>이지는 않겠으며 눈과 입이 커서 시원한 인상일 것이<BR>며 체형은 어깨가 넓은 것이 금형의 특징이며 하체는<BR>약간 빈약하겠습니다. ', 'F23', '23');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 금형(金形)에 속합<BR>니다.<BR><BR>여자답지 않게 잘 발달된 얼굴 윤곽이 특징이며 큰 눈<BR>과 광대가 강한 인상을 남긴다고 볼 수 있겠습니다. <BR><BR>목소리는 시원하여 사교적인 듯한 인상이 강하며 키는<BR>보통이며 동양적인 볼륨감의 몸매의 소유자입니다.', 'F24', '24');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 수형(水形)에 속합<BR>니다. <BR><BR>이마는 조고 눈이 작으며 얼굴의 하단이 널찍하기 때<BR>문에 덕이 있어 보이며 첫인상에서 친근감 있어 보이<BR>는 활동적인 성향이 느껴지겠습니다. <BR><BR>체구는 장대하며 풍만한 가슴과 육감적인 둔부가 은근<BR>한 매력 포인트가 되겠습니다. ', 'F25', '25');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '화형(火形)에 속하는 얼굴이기 때문에 전체적인 느낌<BR>이 화사하며 밝은 느낌이며 외관상으로 눈매가 강렬한<BR>인상이어서 열정적인 느낌을 받습니다. <BR><BR>도톰한 이마에 날렵한 턱 선이 강조된 얼굴이기 때문<BR>에 애기와 같은 느낌이 강하며 큰 눈에 오똑한 콧날이 <BR>자신감에 찬 이미지라 볼 수 있겠습니다. <BR><BR>보통 키에 체구는 약간 글래머에 속합니다.', 'F26', '26');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 오행의 분류에 따르면 날렵하고 감각있<BR>게 생긴 편이기 때문에 화형(火形)에 속한다고 볼 수<BR>있겠습니다. <BR><BR>어려 보이는 마스크에 키가 크겠으며 어깨는&nbsp;좁고 &nbsp;전<BR>반적인 체형은 약간 빈약하지만 패션 감각이 좋은 편<BR>이라 충분히 커버하는 타입입니다. ', 'F27', '27');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 금형(金形)에 속합<BR>니다.<BR><BR>이마가 넓으며 단정한 치아와 턱 선에 각이 있는 것이 <BR>특징이라 볼 수 있겠으며 눈매도 매서운 면이 있기 때<BR>문에 여성으로써 위엄이 있는 모습이라 볼 수 있습니<BR>다. <BR><BR>체형은 그다지 큰 체구가 아니지만 어깨가 넓고 단단<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 해 보이며 스마트한 체형입니다. ', 'F28', '28');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '화형(火形)에 속하는 얼굴이기 때문에 전체적인 느낌<BR>이 화사하고 밝은 느낌이며 외관상으로 눈매가 강렬한<BR>인상이어서 열정적인 느낌을 받겠습니다. <BR><BR>갸름한 얼굴의 미인이라 볼 수 있겠으며 키가 약간 크<BR>고 적당한 볼륨감이 있어 안정된 체형이라 볼 수 있겠<BR>습니다. ', 'F29', '29');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 날렵한 턱 선과 높은 이마가 화<BR>기(火氣)를 나타내지만 눈이 큼직하며 젖살이 살짝 있<BR>으며 두툼한 입술이 특히 아래로 살짝 구부러진 형태<BR>를 봐서 섹시한 매력의 수형(水形)이라 보아야 하겠습<BR>니다. <BR><BR>수형의 특징으로 전반적으로 윤기가 있어 동안이며 볼<BR>륨감 있는 몸매로 성적매력을 발산하는 점이라 볼 수 <BR>있겠습니다. ', 'F30', '30');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 전반적인 윤곽이 둥글기 때문에<BR>토형(土形)에 속하겠습니다. <BR><BR>높은 이마와 도톰한 코가 복 있게 생겼다 할 것이며 작<BR>은 입이 새침해 보이는 느낌을 자아냅니다.<BR>&nbsp;<BR>전체적으로 여성스러우면서도 아기자기한 동안의 형<BR>태를 구성하고 있습니다. <BR><BR>작은 키에 적당한 볼륨감이 형성된 귀여운 타입이라 예상됩니다. <BR>', 'F31', '31');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 수형(水形)에 속하<BR>겠습니다. <BR><BR>물방울처럼 이마는 좁고 입주변과 턱은 넉넉한 타입입<BR>니다. <BR><BR>짙은 눈썹에 촉촉한 눈매와 육감적인 입술이 매력적이<BR>겠으며 체형은 적당한 키에 살집이 약간 있겠으며 볼<BR>륨감이 살아있다고 볼 수 있겠습니다. ', 'F32', '32');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적 기준으로 화형(火形)에 속하기 때문에 얼굴<BR>은 전반적으로 날렵하고 화사한 느낌을 주는 사람입니<BR>다. <BR><BR>도톰한 이마 선에 작은 얼굴에 오뚝한 콧날이 매우 인<BR>상적이며 섹시한 분위기를 연출하므로 의상도 여러 가<BR>지를 소화할 만합니다.<BR>&nbsp;<BR>체형은 적당한 키에 동양적인 몸매의 소유자라 볼 수<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;있겠습니다. ', 'F33', '33');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적 기준으로 화형(火形)에 속하기 때문에 얼굴<BR>은 전반적으로 날렵하고 화사한 느낌을 주는 사람이라<BR>볼 수 있겠습니다. <BR><BR>이목구비는 선명하며 입술이 도톰하므로 강한 인상의 <BR>소유자로 섹시한 매력을 자아내지만 전체적으로 아담<BR>한 키에 동양적인 몸매를 지녔다고 평가할만하겠으며 <BR>목소리가 매력적입니다.<BR>', 'F34', '34');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 둥근 이마와 둥근 얼굴에 동양<BR>적인 선이 매력적인 토형(土形)의 미인입니다.<BR><BR>귀가 크고 동양적인 이미지이기 때문에 다소 신비스럽<BR>다거나 은근히 지성적인 매력을 풍기는 인상이라 볼 <BR>수 있겠으며 키는 적당하며 약간의 볼륨감이 있는 체<BR>형이라 볼 수 있습니다. ', 'F35', '35');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적 기준으로 화형(火形)에 속하기 때문에 얼굴<BR>은 전반적으로 날렵하고 화사한 느낌을 주는 사람입니<BR>다.<BR><BR>표정이 풍부하고 얼굴의 근육이 잘 발달되어 있으므로<B