3', '43');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 토형(土形)에 속합<BR>니다.<BR><BR>동글동글한 얼굴과 콧망울이 특징이며 반달같은 눈에<BR>도 살짝 살집이 있어 복스럽게 생긴 타입이며 팬더 같<BR>은 귀여운 이미지입니다.<BR><BR>작은 키에 통통하고 볼륨있는 글래머형의 체형의 소유<BR>자라 할 수 있겠습니다. ', 'F44', '44');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 그녀의 얼굴은 금형(金形)에 속합<BR>니다. <BR><BR>각진 이마에 턱이 특징이라 전반적으로 단단한 이미지<BR>를 연출하는 얼굴에 속한다 하겠습니다. <BR><BR>진한 눈썹과 함께 콧등에 약간의 살집이 있어 복스러<BR>운 사람임을 암시하고 있으며 적당한 키에 단단해 보<BR>이는 체형의 소유자로 활동감이 느껴지는 사람입니다. ', 'F45', '45');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 관상학적으로 수형(水形)에 속<BR>한다고 볼 수 있겠습니다. <BR><BR>이마는 좁고 광대이하는 두툼한 인상이어서 여유로움<BR>을 느끼게 하는 상이며 탄력있게 오므린 입과 더불어 <BR>넉넉한 턱이 있어 좋은 상을 이루고 있습니다. <BR><BR>수형의 특징답게 둔부가 발달해 있으며 어깨선이 좁아<BR>앙증맞은 느낌의 체형의 소유자라 볼 수 있겠습니다. ', 'F46', '46');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 그녀의 얼굴은 화형(火形)에 속합니다. <BR><BR>눈이 크고 눈썹이 진한 편이므로 강렬한 인상이며 콧<BR>등이 낮고 동그스름한 편이기 때문에 애기 같아 보이<BR>는 이미지가 엿보이기도 합니다. <BR><BR>대체적으로 아기자기한 편이며 키는 작은 편이며 살집<BR>이 있어 보기 좋은 정도의 볼륨감을 형성하고 있는 체<BR>형이라 볼 수 있겠습니다. ', 'F47', '47');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '그녀의 얼굴을 관상학적 측면에서 보면 금형(金形)에 <BR>속합니다.<BR><BR>오관이 뚜렷하면서 얼굴의 틀이 분명하기 때문에 단단<BR>한 느낌을 주기 때문이며 자신감에 찬 분위기가 확연<BR>히 느껴지는 타입입니다. <BR><BR>키는 작지만 곧고 단단한 체형으로 전반적으로 당찬 <BR>이미지를 느낄 수 있겠습니다. ', 'F48', '48');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 목형(木形)에 속하기 때문에 이지적인 <BR>느낌을 주는 스타일이겠습니다. <BR><BR>전반적으로 동양적인 선을 그리고 있으며 오목조목한 <BR>형태이기 때문에 아기자기한 인상입니다. <BR><BR>키는 작겠으며 아담한 체구에 귀여운 매력의 여성입니<BR>다. ', 'F49', '49');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '통통하고 안정된 느낌에 입술이 도톰한 형태로 관상학<BR>적으로는 수형(水形)에 속합니다.<BR><BR>아기자기하고 약간 쳐진 눈의 소유자이겠으며 눈웃음<BR>을 치거나 보조개가 특징이 잘 살아나는 귀여운 상의 <BR>소유자라 볼 수 있겠습니다. <BR><BR>키는 작지만 촉촉하고 시원한 목소리에 다소 글래머러<BR>스한 미인입니다. ', 'F50', '50');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 사각형의 단정한 형태의 얼굴로써 <BR>오행의 금형(金形)에 속한다고 볼 수 있겠습니다. <BR><BR>진한 눈썹에 오관이 모두 뚜렷합니다. 활동적인 느낌<BR>을 어필하는 인상이겠으며 낭랑한 음성에는 약간의 울<BR>림이 느껴지는 목소리의 소유자입니다. <BR><BR>체형은 보통이며 얼굴과 같이 약간의 탄력이 있어 보이<BR>겠습니다. ', 'F51', '51');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '귀여운 인상에 갸름한 형태로 관상학적으로는 금형(金<BR>形)에 속하는 얼굴입니니다. 잔잔한 눈빛에 검게 빛나<BR>는 눈동자는 이지적인 분위기를 연출하겠습니다. <BR><BR>가는 목선과 스마트한 사지를 가지고 있어 보호본능을<BR>느끼게 하는 체형이며 아담하지만 굴곡이 잘 살아 있<BR>어 여러 옷을 잘 소화하는 여성입니다. ', 'F52', '52');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '음양오행의 분류에 따른 관상학으로 보면 긴 얼굴이 <BR>목형(木形)에 가까운 얼굴입니다. <BR><BR>눈이 크면서 깊은 느낌을 주며 단아하게 뻗은 콧대가 <BR>도도하며 지적이어 보이는 분위기를 연출하고 있습니<BR>다. <BR><BR>체형도 목형의 기질 그대로 길쭉한 서구형의 체형이라<BR>볼 수 있겠습니다. ', 'F53', '53');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 날렵하고 감각 있게 생긴 얼굴<BR>이기에 화형(火形)에 속하는 관상입니다. <BR><BR>오뚝한 콧날과 함께 불꽃처럼 화사한 이미지의 여인으<BR>로써 표정에 생기가 풍부하며 피부가 하얀 미인이라 <BR>할 것입니다. <BR><BR>체형은 큰 키에 가냘픈 체구의 소유자라 할 수 있겠습<BR>니다. ', 'F54', '54');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '음양오행의 관점으로 보면 토형(土形)에 속한다고 볼 <BR>수 있으며 진한 눈썹과 짙은 검은 색의 눈동자가 강한 <BR>인상을 내비치는 특징입니다. <BR><BR>이목구비도 뚜렷히 살아있어서 표정이 살아있다 할 수<BR>있겠으며 작은 키에 못지않는 존재감을 가지고 있겠으<BR>며 목소리에는 힘이 있어 당찬 이미지의 여인이겠습니<BR>다. ', 'F55', '55');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적으로 보면 오행의 화기운이 강하게 느껴집니<BR>다. 결정적으로 역삼각의 얼굴에 코가 큰 편이므로 전<BR>형적인 화형(火形)이며 재물운이 따르는 상입니다. <BR><BR>큰 키와 마른 체형이 개성을 잘 살리고 있겠습니다. <BR><BR>얼굴과 이목구비가 작아 어려 보이는 동안이며 목소리<BR>는 작고 촉촉한 듯 하여 애교가 베어나는 타입의 여성<BR>이라 볼 수 있습니다. <BR>', 'F56', '56');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '음양오행의 관점에서 보면 이목구비는 큼직하며 얼굴<BR>이 각이 잘 살아 있으므로 금형(金形)에 속하는 미인이<BR>라 볼 수 있겠습니다. <BR><BR>진한 눈썹에 시원한 느낌의 인상이며 키마저 크고 글<BR>래머러스한 체형의 소유자입니다. <BR><BR>서양적인 매력이 잘 살아나는 타입으로 활동적인 면이 <BR>강한 여인입니다. ', 'F57', '57');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '밝은 얼굴에 오목조목한 귀여움이 가득한 얼굴입니다.<BR><BR>키는 작으며 어려보이는 외모이며 다소 말괄량이 같아<BR>보이는 활동력이 있어 때로는 과감해 보이는 면을 나<BR>타내고 있겠습니다. <BR><BR>오행에서 수형(水形)에 속하는 관상이기 때문에 주변<BR>사람을 편안하게 하는 면이 있습니다.', 'F58', '58');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '작은 얼굴에 약간 좁은 듯한 이마에 큰 입술과 턱이 특<BR>징이겠으며 음양오행의 관점에서 보면 전형적인 수형<BR>(水形)에 속하는 관상입니다. <BR><BR>넉넉해 보이는 인상에 여유가 흐르며 낙천적이어 보이<BR>는 기색이 강하며 특히 모성애가 강한 인상입니다.<BR><BR>체형도 키는 작지만 통통하고 글래머러스한 불륨감의 <BR>소유자이겠습니다. ', 'F59', '59');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '다소 길쭉한 느낌의 얼굴에 눈과 코가 길게 자리한 인<BR>상으로 음양오행에서 목형(木形)에 속하는 관상에 해<BR>당됩니다. <BR><BR>목형의 특징적으로 사려가 깊고 매사에 신중한 면이 <BR>장점이라 볼 수 있겠으며 얼굴과 비례해서 체형 역시 <BR>키가 크며 시원시원한 이미지를 가진 미인입니다. ', 'F60', '60');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '이마가 두드러지는 것이 특징입니다. 표정이 풍부하며<BR>화사한 느낌이라 볼 수 있으므로 오행의 분류로 화형<BR>(火形)에 속하는 관상입니다. <BR><BR>이목구비가 동양적인 스타일로 얌전한 듯 하지만 광대<BR>가 발달해 있어 표정이 움직일 때와 그렇지 않을 때가 <BR>다른 복합형이며 체구는 작은 편에 속하겠습니다. ', 'F61', '61');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '얼굴이 길고 갸름한 이지적인 스타일입니다. 음양오행<BR>의 목형(木形)에 속하는 관상이며 크고 또렷한 눈동자<BR>가 매력적입니다. <BR><BR>전체적으로 깨끗하고 단정한 이미지를 연출하므로 정<BR>장이 잘 어울리는 미인이며 전체적인 체형도 약간의 <BR>키와 볼륨이 있어 은근히 섹시한 매력이 엿보인다 하<BR>겠습니다. ', 'F62', '62');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전체적으로 둥근 이미지의 얼굴로 관상학적으로 오행<BR>을 따지면 토형(土形)에 속합니다. <BR><BR>모든 것을 포용하는 특징이 있는 만큼 편안한 기운을 <BR>가지고 있다고 볼 수 있습니다.<BR><BR>눈은 작겠으며 이목구비가 전형적인 동양적인 스타일<BR>로 작고 아기자기 한 인상이겠으며 체형은 크고 살집<BR>이 다소 있겠습니다. ', 'F63', '63');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행상으로 목형(木形)에 속하는 타입으로 길고 갸름<BR>한 얼굴이겠습니다. <BR><BR>피부는 화사한 흰 빛을 띄고 있겠습니다. 전체적인 느<BR>낌은 여성스러우면서 활동가다운 생기가 느껴지는 이<BR>미지입니다. <BR><BR>매사에 호기심이 많은 듯 눈에는 빛이 나며 키가 크기<BR>때문에 옷이 잘 받는 모델과 같은 서구적 체형입니다. <BR>', 'F64', '64');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '그녀의 얼굴은 길기 때문에 목형(木形)이 주(主)를 이<BR>루며 화(火)의 기운도 일부 느껴집니다. <BR><BR>얼굴이 길고 날렵한 느낌이라서 다소 야한 느낌을 주<BR>는 경향이 있겠으며 눈동자가 크고 눈썹이 짙어 도발<BR>적인 인상을 어필하는 미인입니다. <BR><BR>전반적으로 서구적인 이미지의 소유자며 키가 커서 다<BR>소 부담이 될 수도 있겠습니다. ', 'F65', '65');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행으로 보면 목형(木形)에 해당됩니다. 표정이 풍부<BR>하고 산뜻하여 표정이 화사한 느낌이 있습니다. <BR><BR>전반적으로 애교스러운 면이 많은 이미지여서 여성스<BR>러운 분위기가 잘 살아나는 타입입니다. <BR><BR>체형은 동양적인 스타일의 적당한 키에 은근한 글래머<BR>형의 미인이겠습니다. ', 'F66', '66');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 작은 얼굴에 하단부가 좁고 갸<BR>름하므로 화형(火形)에 속하는 관상입니다. <BR><BR>눈매가 크고 선명하고 때문에 불이 타오르는 듯한 열<BR>정을 가진 얼굴이라 볼 수 있겠습니다. 체형은 작고 아<BR>담한 편이지만 은근히 볼륨이 있는 몸매입니다. ', 'F67', '67');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '얼굴이 희고 길며 오행의 분류로 수형(水形)에 해당하<BR>는 관상입니다. <BR><BR>특징적으로 차분하고 넉넉한 느낌의 모성애가 특징입<BR>니다. 눈동자와 입술이 촉촉하다고 볼 수 있겠습니다. <BR><BR>전체적인 이미지가 약간 섹시함이 강조되는 글래머형<BR>의 체형의 미인입니다.', 'F68', '68');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '똘망똘망한 둥글고 큰 눈에 갸름한 계란형의 얼굴입니<BR>다. 오행상의 토형(土形)에 해당하는 관상의 소유자로<BR>써 지혜롭고 신중한 타입에 속합니다. <BR><BR>반달형의 큰 눈에 눈동자가 짙은 갈색으로써 순수한 <BR>이미지로 소녀티가 많은 미인이라 볼 수 있겠으며 아<BR>담한 체형의 여성적인 매력이 강하다 할 수 있겠습니<BR>다. ', 'F69', '69');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '갸름하면서 볼 살이 많으며 이마는 좁은 전형적인 수<BR>형(水形)의 얼굴의 소유자에 속하겠습니다. <BR><BR>나이보다 훨씬 어려보이는 인상으로 인해 말괄량이처<BR>럼 보이며 주변 사람을 즐겁게 할 정도의 밝은 이미지<BR>의 소유자라 할 수 있겠습니다. <BR><BR>작은 키에 발육이 다소 더디기도 합니다. ', 'F70', '70');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '동그란 얼굴에 적당한 융기가 있으며 눈매도 부드러운<BR>느낌입니다. <BR><BR>음양오행의 관점에서 보면 전형적인 토형(土形)에 속<BR>하는 관상입니다.<BR><BR>전반적으로 중화된 인상으로 편안함을 주는 것이 특징<BR>이며 약간 큰 키에 살집이 있어서 다소 글래머러스한 <BR>몸매의 소유자라 할 수 있겠습니다. ', 'F71', '71');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '이마와 턱이 넓고 반듯하며 콧대도 오뚝하므로 얼굴은<BR>금형(金形)에 가까운 얼굴이라 볼 수 있겠습니다. <BR><BR>전체적인 느낌이 단정한 이미지를 연출하고 있으므로 <BR>정장이 잘 어울리는 인상이라 볼 수 있겠으며 체형은 <BR>다소 큰 키에 동양적인 아담한 체형의 소유자에 속합<BR>니다. ', 'F72', '72');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적인 얼굴의 이미지는 둥근 이미지에 이목구비는 <BR>안정감 있는 동양적인 선을 그리고 있는 미인이겠습니<BR>다. <BR><BR>오행의 관점에서 볼 때에 토형(土形)에 속하는 관상입<BR>니다.<BR><BR>&nbsp;주변의 분위기를 알게 모르게 조율하는 편안한 타입<BR>이며 목소리도 나긋나긋하다고 볼 수 있겠습니다. <BR>체형은 토기운에 의해 적당히 볼륨감이 있어 글래머러스하며&nbsp;키는 다소 작습니다.<BR>', 'F73', '73');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '음양오행에서는 수형(水形)에 속하는 미인입니다. <BR><BR>화사한 얼굴빛에 전반적으로 단정하고 하단부가 넓은 <BR>편이며 콧대도 오뚝하기 때문에 자신의 주장이 강합니<BR>다. <BR><BR>정장이나 캐주얼이나 모두 잘 맞는 영향이 있으며 체<BR>형은 마른 타입이면서 볼륨감이 뛰어나기 때문에 매우<BR>섹시한 타입의 몸매의 소유자입니다. ', 'F74', '74');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '얼굴이 피부는 희고 화사한 느낌을 주며 길이가 좀 있<BR>겠습니다. <BR><BR>얼굴은 오행으로 목형(木形)에 가까운 얼굴입니다. 표<BR>정은 차분하며 조용한 이미지를 연출하는 분위기파 입<BR>니다. <BR><BR>키가 특히 늘씬하겠습니다. <BR><BR>단정한 이미지로 인해 전반적으로 정장풍의 의상을 잘 소화한다고 볼 수 있겠습니다. <BR>', 'F75', '75');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 이목구비의 경계가 확실합니다. 턱 선과<BR>이마가 잘 발달했으므로 오행의 분류로 보면 금형(金<BR>形)에 속합니다.<BR><BR>오뚝한 콧날과 강렬한 눈빛이 자기주장이 확실하게 나<BR>타나 보이며 가녀린 몸매이지만 반듯한 체형에 볼륨감<BR>이 잘 살아나는 몸매의 소유자라 볼 수 있습니다. ', 'F76', '76');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적인 얼굴 형태는 적당한 살집에 각이 잘 살아 있<BR>겠습니다. <BR><BR>눈은 반달을 그리며 잘 웃는 매력이 있습니다. 음양오<BR>행의 분류로 금형(金形)에 가깝다고 볼 수 있습니다. <BR><BR>주변사람을 편안하게 해주는 넉넉한 심성과 낙천적인 <BR>이미지가 강합니다. 키는 작겠으며 살집이 있어 적당<BR>한 볼륨이 있습니다. ', 'F77', '77');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적인 관점으로 보면 얼굴은 목형(木形)에 가까<BR>운 얼굴입니다. 얼굴이 피부는 희며 화사합니다. <BR><BR>얼굴 형태는 길이가 좀 있지만 상하의 균형이 잘 맞겠<BR>습니다. 키가 커서 빈약해 보이는 면이 없지 않지만 몸<BR>매가 균형감이 잘 잡혀 있어 미인이겠습니다. ', 'F78', '78');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '표정은 차분하며 오행의 분류로 보면 목형(木形)에 속<BR>하는 사람으로서 얼굴의 길이가 좀 있겠습니다. <BR><BR>이마가 발달했기 때문에 여러 가지의 헤어스타일을 소<BR>화하는 패셔너블한 면이 있겠으며 키가 크고 약간 허<BR>스키한 목소리의 소유자입니다. ', 'F79', '79');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 보면 토형(土形)에 속하는 사람으로써 <BR>얼굴의 피부는 희고도 화사하며 길이가 다소 있지만 <BR>동그스름한 이미지가 강합니다. <BR><BR>웃음이 많거나 애교가 강하며 키도 약간 크며 둔부의 <BR>라인이 잘 발달해 있어 치마가 잘 어울린다고 볼 수 있<BR>겠습니다. ', 'F80', '80');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '얼굴생김새 당신의 배우자가 될 사람은 오행의 분류로<BR>안정감 있는 토형(土形)의 관상의 소유자입니다. <BR><BR>다소 마른 체구에 긴 얼굴은 날카로운 느낌을 주게 되<BR>며 눈이 매력적인 사람입니다. <BR><BR>모발이 짙어 인상은 다소 강렬한 이미지를 연출합니<BR>다. 평상시엔 고상한 듯한 이미지이며 주변사람에게 <BR>적절히 대응해 주는 센스가 있는 사람입니다. <BR>', 'M01', '81');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '서글서글한 외모에 오행의 금형(金形)에 속한 관상입<BR>니다. 눈썹은 짙고 코가 큰 것이 특징인 사람입니다. <BR><BR>전반적인 느낌은 화려하다는 느낌보다 적절한 평범함<BR>과 편안함으로 첫 만남이 크게 어색하거나 낯설지는 <BR>않을 것입니다. <BR><BR>웃음이 매력적이며 낙천적이지만 행동에 적당한 무게<BR>감이 있어 중후함이 베어 있는 매력적인 사람입니다. <BR>', 'M02', '82');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '대체적으로 강렬한 인상을 풍기는 사람이며 단단한 느<BR>낌을 가진 오행의 금형(金形)상을 지닌 사람입니다. <BR><BR>자기주관이 아주 뚜렷한 사람인 듯한 뉘앙스가 강하게<BR>풍긴다고 볼 수 있습니다. <BR><BR>이러한 사람은 대체적으로 자기 표현력이 강하게 나타<BR>나므로 오관이 뚜렷하며 얼굴이 크거나 각지고 예리함<BR>을 느낄 수 있습니다. ', 'M03', '83');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 금형(金形)에 속하는 관상의 소유자입<BR>니다. 다소 긴 듯한 느낌을 주는 편이며 안경이 잘 어<BR>울리는 아기자기한 형태를 하고 있는 얼굴입니다. <BR><BR>코와 입은 크거나 뚜렷한 편이며 턱 선이 발달되어 있<BR>어 이목구비가 매우 선명하게 보입니다. 대체적으로 <BR>편안한 느낌을 주는 인상이지만 개성이 강한 분위기를<BR>연출하는 사람입니다. ', 'M04', '84');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '다소 긴 느낌의 얼굴형태의 오행으로 목형(木形)에 해<BR>당하는 상입니다. <BR><BR>이목구비가 잘 발달되어 있으며 특히 눈이 뚜렷하고 <BR>눈썹이 진하고 전반적으로 호남형의 잘 생긴 얼굴이라<BR>볼 수 있습니다. <BR><BR>깔끔한 느낌을 주는 이목구비로 캐주얼이나 심플한 옷<BR>이&nbsp;잘 어울리는 약간 반항적 기질이 엿보이는 사람입<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 니다. ', 'M05', '85');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 산뜻한 느낌을 주며 하단부가 넉넉한 느낌<BR>인 형태의 얼굴을 하고 있겠으며 이마는 야간 좁지만 <BR>분명하여 시원합니다. <BR><BR>오행의 수형(水形)에 해당하는 상이며 이목구비는 눈<BR>을 제외한 나머지가 날렵한 느낌이겠으며 단정한 느낌<BR>의 헤어스타일이 잘 어울립니다. <BR><BR>대체적으로 깔끔한 외모에 정장풍이나 격식 있는 옷을<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 자연스럽게 소화할만한 이미지를 가진 사람입니다. ', 'M06', '86');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 금형(金形)에 해당하는 관상의 소유자<BR>입니다.<BR>&nbsp;<BR>얼굴은 장방형으로 단단하고 넓은 느낌이지만 자세히 <BR>보면 계란형을 이룹니다.<BR><BR>다소 나이가 든 것 같은 중후한 멋을 가진 얼굴이라 볼<BR>수 있습니다. <BR><BR>이마가 특히 선명한 편이므로 대체적인 느낌이 자신감과 자기개성을 표현하는데 있어 유리한 <BR>외모입니다. ', 'M07', '87');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '날카로운 듯한 인상을 주게 되는 형태로 오행의 분류<BR>상 금형(金形)입니다. <BR><BR>이마가 넓고 턱의 형태가 뚜렷하며 코와 입이 시원스<BR>럽게 큰 편입니다. <BR><BR>입술선이 뚜렷한데 턱 선이 선명하고 예리한 각을 이<BR>루고 있어 약간 날카로운 느낌을 주는 사람이라 볼 수 <BR>있지만 전반적으로 성품이 편안한 사람입니다. ', 'M08', '88');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 길쭉한 느낌의 긴 얼굴의 목형(木形)에 해<BR>당하는 관상의 소유자입니다. 코와 턱의 선이 약간은 <BR>밋밋한 느낌을 주기도합니다. <BR><BR>표정의 변화도 풍부하지는 않은 편이라 보는 사람으로<BR>하여금 쉽게 다가서기는 어려울 것 같은 느낌의 보수<BR>적인 뉘앙스를 풍기는 남자입니다. <BR><BR>약간 싸늘한 듯한 분위기가 매력이면서 단점이기도 합<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;니다. ', 'M09', '89');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '길면서 둥그스름한 느낌으로 음양오행의 토형(土形)에<BR>속하는 관상의 소유자입니다. <BR><BR>대체적으로 무난한 이목구비에 눈이 예쁘게 생긴 타입<BR>입니다. <BR><BR>이마가 잘 발달해 있어 머리가 좋은 듯한 인상을 주게 <BR>되며 실제로 재치 있는 사람이기도 합니다. <BR><BR>키가 큰 편이라서 정장차림이 잘 어울리며 주변 사람들이 부담스러워 하지 않을 정도의 웃음을<BR>주는 좋은 인상이 뛰어난 사람이라 볼 수 있습니다. ', 'M10', '90');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 화형(火形)에 속하는 관상의 소유자입<BR>니다. <BR><BR>전반적인 느낌은 밝은 색의 피부에 섬세한 듯 보이기<BR>도 하며 고상하고 지적인 느낌을 주는 인상입니다. <BR><BR>눈이 예쁘고 사슴처럼 커다랗다는 점이 이 사람의 매<BR>력이며 계란형으로 날카로운 형태의 턱 선입니다. <BR><BR>체형은 약간 키가 작은 편이며 살집은 보통으로 타이트한 몸매가 되겠습니다. ', 'M11', '91');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 금형(金形)에 해당하며 현대적인 느낌<BR>의 세련된 이목구비에 눈매가 예쁘기 때문에 다소 중<BR>성적인 듯한 인상을 주지만 길고 각진 턱의 소유자로<BR>서 남성적인 느낌이 은근히 숨어있는 얼굴입니다. <BR><BR>높은 콧날에 피부 톤은 밝은 편이라 귀공자와 같은 느<BR>낌을 주는 스타일이므로 섹시한 느낌의 남자라 볼 수 <BR>있겠습니다. ', 'M12', '92');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 금형(金形)으로 강인해 보이는 느낌을 <BR>주는 인상의 소유자입니다. 활동적이며 자기표현이 강<BR>한 편입니다. <BR><BR>전체 얼굴윤곽이 뚜렷한 편이며 눈썹과 눈이 진하고 <BR>입술은 힘 있게 다물고 웃을 때엔 보조개가 보입니다. <BR><BR>턱 선도 잘 발달되어 있는 스타일이므로 꽤 남성다운 <BR>매력을 발산하는 남성입니다. ', 'M13', '93');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '얼굴의 하단부위가 넉넉한 편이므로 오행의 수형(水<BR>形)에 해당합니다. <BR><BR>털털한 듯한 인상에 윤곽이 잘 발달해 있어 이국적인<BR>듯한 느낌을 주는 얼굴형입니다. <BR><BR>어느 한쪽으로 발달하지는 않았지만 여러 가지의 스<BR>타일을 소화할 수 있는 안정된 느낌의 인상입니다. <BR><BR>대체적으로는 편안함을 좋아하므로 약간의 자유분방한 듯한 느낌을 받을 수 있습니다. ', 'M14', '94');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 보면 화형(火形)에 해당하며 미려한 턱 <BR>선과 이목구비가 꽃 미남을 연상시키는 편입니다. <BR><BR>밝은 웃음과 아기자기하면서도 도시적인 외모가 여성<BR>들에게 인기를 끌기 쉬운 타입으로 보입니다. <BR><BR>처음에는 호감보다 오히려 부담스러울 수 있을 정도의<BR>다소 느끼함을 느낄 수 있지만 결국 친여성적인 느낌<BR>이 당신을 사로잡을 것입니다. ', 'M15', '95');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 전형적인 화형(火形)의 관상이며 진지<BR>함과 더불어 우스꽝스러운 느낌의 이미지가 함께 어우<BR>러진 사람입니다. <BR><BR>전반적인 얼굴의 윤곽이 분명하면서도 또렷하고 표정<BR>이 없을 때엔 진지한 느낌을 주기도 합니다. <BR><BR>하지만 본래 천성은 표정이 풍부하므로 웃거나 여러 <BR>사람과 이야기를 나눌 때에는 익살스러운 면도 강하게<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 나타나기도 합니다. ', 'M16', '96');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 수형(水形)의 관상입니다. <BR><BR>약간 아기 같은 느낌과 함께 모호한 눈빛을 하고 있으<BR>므로 보편적으로 눈을 마주치기가 어렵다거나 첫인상<BR>에서는 그다지 사교적이지 않아 보이는 느낌을 주는 <BR>사람이라 느낄 수 있겠습니다. <BR><BR>그러나 시간이 지날수록 편해지는 인상의 소유자라 볼<BR>수 있는 부드러운 매력의 남성입니다. 키는&nbsp;큰 편이며&nbsp;<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;운동을 좋아하여 균형 잡힌 몸매의 소유자입니다. ', 'M17', '97');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '이목구비는 뚜렷한 편이며 전체적으로 뚜렷한 테두리<BR>가 형성되어 있습니다. <BR><BR>오행의 금형(金形)의 관상에 속하는 얼굴입니다. 눈이 <BR>부리부리한 것이 특징이며 코는 굵고 윤기가 흐르는 <BR>듯한 느낌으로 호남 형입니다. <BR><BR>키는 보통의 키에 체격은 건장하며 전체적인 체형에서<BR>다부진 이미지가 선명하게 느껴지겠습니다. ', 'M18', '98');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '낙천적인 듯한 느낌의 인상의 소유자이며 각이 발달하<BR>여 오행의 관점에서 보면 금형(金形)에 속하는 관상의 <BR>소유자입니다. <BR><BR>대체적으로 편안한 인상을 느끼게 하며 크지 않은 이<BR>목구비이지만 그 선이 확실하고 뚜렷하게 나누어져 <BR>있습니다. <BR><BR>전체적으로 넓고 각진 얼굴이 대중을 압도하는 카리스<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 마를 느끼게 합니다. ', 'M19', '99');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '역삼각 형태로 오행의 화형(火形)에 속하는 인상입니<BR>다. 외모는 수수한 편으로 잘 생겼다는 느낌보다는 편<BR>안하다는 느낌이 강한 사람입니다. <BR><BR>갸름한 얼굴형에 작고 깜찍한 느낌의 표정과 때때로 <BR>느껴지는 익살스러움이 있는 타입의 동안이 되겠습니<BR>다. <BR><BR>약간은 왜소한 키에 피부가 좋아서 나이에 비해 어려<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;보이며 유머감각이 좋은 편입니다. ', 'M20', '100');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 토형(土形)에 해당하는 둥근 인상입니<BR>다. 얼굴 한가득 익살스러움과 재치가 엿보이는 듯 웃<BR>는 모습이 인상적입니다. <BR><BR>살집이 약간 있어 부드러운 느낌이며 전반적으로 이목<BR>구비는 작고 오밀조밀한 편이겠습니다. <BR><BR>잘 생겼다는 느낌보다는 개성이 강한 인상이 특징적이<BR>라 볼 수 있으며 눈썹은 짧고 이마가 넓어서 머리가 좋<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 은 듯한 느낌을 주는 사람입니다. ', 'M21', '101');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 토형(土形)에 속하는 인상으로 둥근 이<BR>미지입니다. <BR><BR>이마가 시원하게 크고 넓은 편이며 전반적인 이목구비<BR>는 이마의 면적으로 인해 아래로 자리한 형태입니다. <BR><BR>귀가 커서 보는 사람으로 하여금 강한 개성을 느끼게 <BR>하는 것이 특징이며 머리가 좋아 보이는 타입입니다. <BR>키는 적당한 키에 어깨가 넓은 편입니다. ', 'M22', '102');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '화형(火形)에 속하는 관상의 소유자로 까다롭게 생긴 <BR>이미지와 더불어 약간 우수에 젖은 듯한 모습이 인상<BR>적이라 느낄 만합니다. <BR><BR>눈썹과 머리숱이 많고 색이 짙은 편이며 피부가 흰 편<BR>이기 때문에 날카로운 느낌을 주게 되는 사람입니다. <BR><BR>턱이 뾰족하거나 볼 살이 없는 편이므로 당신의 모성<BR>애를 은근히 자극하는 면이 있겠습니다. ', 'M23', '103');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '길고 세련된 이목구비에 오행의 목형(木形)에 속하는 <BR>관상입니다. 남성다운 느낌이 느껴지는 외모라 할 수 <BR>있습니다. <BR><BR>눈은 길고 깊은 편이며 그의 미소는 차가운 듯 보이며 <BR>웃음소리는 잘 나지 않는 편입니다. <BR><BR>키도 크며 얼굴도 길쭉하면서 갸름하기 때문에 전반적<BR>인 이미지가 날카롭다는 느낌을 강하게 받는 편이라&nbsp;<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;볼 수 있겠습니다. ', 'M24', '104');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 관점에서 보면 토형(土形)에 속하는 관상으로 <BR>둥근 이미지라 볼 수 있겠습니다. <BR><BR>전반적인 얼굴의 윤곽이 남성다운 선을 구성하고 있지<BR>만 대체적으로 표정의 변화에 따라 수줍은 듯하기도 <BR>하며 냉정하고 차가운 카리스마적 이미지를 연출하기<BR>도 하는 등의 표정변화가 많은 사람입니다. <BR><BR>일반적인 표정은 날카롭고 냉철한 이미지를 연출하고 <BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 있지만 입술이 도톰하여 부드러운 느낌 또한 주는 사<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;람입니다. <BR>', 'M25', '105');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 보면 전형적인 금형(金形)의 관상입니<BR>다. 약간 그을린 듯한 구릿빛 피부에 단단해 보이는 인<BR>상이 강렬한 느낌을 주는 사람입니다. <BR><BR>큰 키에 핸섬한 느낌의 미소와 진한 이목구비가 여성<BR>에게 강한 어필을 줍니다. 촉촉한 피부의 탄력이 섹시<BR>한 매력을 발산하는 사람입니다. ', 'M26', '106');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '둥그스름한 얼굴윤곽으로 보아 토형(土形)의 인상임을<BR>알 수 있습니다. <BR><BR>낙천적인 성격을 보여주는 듯한 해맑은 웃음과 매력적<BR>인 눈웃음이 특징이겠으며 전반적인 덩치와 신장이 강<BR>인한 느낌을 주는 사람입니다. <BR><BR>해학적인 듯한 미소나 작지만 웃음을 머금은 눈의 조<BR>화가 주변 사람을 편안하게 하는 요소가 된다고 볼 수 <BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 있습니다. ', 'M27', '107');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '진한 눈썹에 눈이 작고 얼굴에는 적당한 윤기가 있어 <BR>인간미가 느껴진다고 볼 수 있겠으며 턱 선이 역 삼각<BR>을 이루고 있어 화형(火形)의 인상임을 알 수 있습니<BR>다. <BR><BR>꽃미남이 아니라면 반대로 강렬한 개그이미지를 연출<BR>하고 있는 사람이라 느껴지는 얼굴입니다. <BR><BR>키는 적당하며 신체는 왜소한 느낌으로 당신의 모성애<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 를 자극하는 사람이라 볼 수 있습니다. ', 'M28', '108');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '나이에 비해 어려보이는 동안입니다. 오행의 관점에서<BR>보면 각이 뚜렷한 금형(金形)에 속하며 소년시절의 개<BR>구쟁이 같은 면이 나타나는 상을 하고 있는 천진난만<BR>해 보이는 상입니다. <BR><BR>눈은 작거나 안으로 감춰진 듯한 인상에 눈웃음이 깊<BR>고 매력적입니다. 눈동자가 크고 까만 편이어서 지혜<BR>로워 보이며 키는 약간 작은 키에 귀여운 인상을 남<BR>깁니다.', 'M29', '109');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전체적으로 각이 뚜렷한 금형(金形)의 관상의 소유자<BR>이며 갸름하고 날카롭게 흐르는 턱 선과 큰 눈에 도톰<BR>한 입술이 인상적인 남자입니다. <BR><BR>날카롭고 강렬한 이미지에 다소 여성스러운 이중적인 <BR>느낌의 매력을 발산하며 다소 터프해 보이는 남성적인<BR>매력이 여성들을 압도하는 카리스마를 지녔습니다. <BR><BR>체구는 약간 마른 편이며 키가 큰 편일 것입니다. ', 'M30', '110');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '부드러워 보이는 얼굴에 눈매가 강렬한 편이기 때문에<BR>의외로 강한 인상을 심어주는 사람입니다. <BR><BR>오행의 화형(火形)에 속하는 관상이며 약간 갸름한 형<BR>태의 얼굴에 작지만 높은 코와 힘 있게 다문 입술을 지<BR>녔습니다. <BR><BR>눈은 약간 부리부리한 느낌을 주는 편이기 때문에 보<BR>는 이의 시선을 압도하며 자신의 표현을 무언으로 전<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;하는 듯합니다. 체구는 비교적 평범한 편에 속합니다. ', 'M31', '111');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '둥근 인상의 토형(土形)에 속하는 관상의 소유자입니<BR>다. 골격이 두드러진 편이기 때문에 얼굴의 윤곽이 뚜<BR>렷하며 약간 서구적인 느낌을 주는 인상입니다. <BR><BR>광대와 턱이 강하게 발달해 있으며 적당한 표정 변화<BR>가 있어 인상이 풍부한 사람입니다. <BR><BR>키는 현대적인 시각으로 보면 비교적 작다고 느끼겠지<BR>만 체격은 다부진 편이겠습니다. ', 'M32', '112');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '약간 둥근 얼굴로 오행의 분류상 토형(土形)에 속하는 <BR>관상입니다. 살집은 약간 있으면서 턱은 갸름한 타입<BR>의 얼굴입니다. <BR><BR>눈이 동그랗고 눈썹과 함께 눈 꼬리가 처져 있으며 코<BR>는 약간 낮은 편이지만 코끝이 콧등보다 급격히 높아<BR>지는 구조에 입술이 도톰하여 다소 푸근한 이미지를 <BR>연출하고 있습니다. <BR><BR>체격은 보통 키에 살집은 좀 있는 편이지만 체중의 변화가 좀 있을 것입니다. ', 'M33', '113');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '약간 굴곡 있는 얼굴형에 하단이 넓으므로 오행의 수<BR>형(水形)에 속합니다. 눈썹이 진하고 입술이 도톰하며 <BR>아래로 향하고 있지만 대체로 웃는 표정입니다. <BR><BR>턱선이 갸름하게 흐르는 편이기 때문에 체중조절에 <BR>따라 날카로워 보이기도 하고 편안해 보이기도 하는 <BR>얼굴입니다.<BR><BR>키는 약간 큰 키에 골격은 보통이거나 약간 큰 편으로 <BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 다부진 체격입니다. ', 'M34', '114');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '각진 형태의 얼굴로 오행의 금형(金形)에 속하는 관상<BR>입니다. 이목구비가 뚜렷한 편이기 때문에 잘생긴 사<BR>람이라 볼 수 있습니다. <BR><BR>그러나 전체적인 얼굴형이 갸름한 계란형이거나 역삼<BR>각형이기 때문에 인상이 강렬하면서도 날카로워 보이<BR>는 타입입니다. <BR><BR>키가 좀 큰 편이며 팔 다리가 길어서 마치 운동선수 같<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;은 느낌의 건강함이 느껴지는 체형입니다. ', 'M35', '115');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전형적인 화형(火形)의 관상으로 입술엔 힘이 있어 보<BR>이는 상입니다. <BR><BR>피부가 흰 편이기 때문에 실제 나이보다 젊어 보이며<BR>얼굴이 긴 편에 이마는 좁고 턱이 뾰족하기 때문에 날<BR>카로운 느낌을 주는 인상입니다. <BR><BR>키는 보통으로 체격은 마른 편이지만 단단해 보이며 어<BR>떤 옷을 입더라도 옷이 잘 어울립니다. ', 'M36', '116');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '다소 길쭉한 편이며 갸름한 얼굴형으로 화형(火形)의 <BR>관상입니다. <BR><BR>대체적으로 역삼각형으로 턱이 좁고 눈빛이 매서우며 <BR>약간은 밋밋해 보일 만한 동양적인 얼굴형입니다. <BR><BR>때문에 날카로워 보이는 면이 많습니다. 피부가 좋고 <BR>키가 큰 늘씬한 체형을 가져 모델 같아 보이며 손이 고<BR>운 편이라 감각적인 면이 많습니다. ', 'M37', '117');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '둥근 턱에 오행상 수형(水形)에 속하는 관상의 소유자<BR>입니다. <BR><BR>얼굴이 작고 갸름하기 때문에 어려보이며 눈은 작고 <BR>약간 처진 편입니다. <BR><BR>유행에 맞는 스타일의 경향으로 인해 여성에게 부드럽<BR>게 어필되는 사람입니다. 체형은 보통에 속하며 키는 <BR>보통이 약간 넘는 편이겠습니다. ', 'M38', '118');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 관점에서 화형(火形)에 속하는 관상으로 전반<BR>적으로 갸름하고 작은 얼굴에 속합니다. <BR><BR>눈썹이 진한 편이며 입술은 얇고 작은 편이라 강한 인<BR>상을 심어주는 이미지입니다. <BR><BR>체형은 안정감 있는 표준이며 키도 보통이 약간 넘는 <BR>편이겠습니다. 고상해 보이며 유행을 따르는 스타일의<BR>귀공자 같은 이미지를 연출한다고 볼 수 있겠습니다. ', 'M39', '119');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '작은 얼굴에 눈은 큰 편이며 긴 얼굴로 오행의 목형(木<BR>形)에 해당 된다고 볼 수 있습니다. <BR><BR>눈이 작지만 귀여운 느낌을 연출하고 있겠으며 전반적<BR>으로 분위기 있는 이목구비를 형성하고 있습니다. <BR><BR>겉으로 보기에 체형이 단단해 보이며 마른 체격입니<BR>다. <BR><BR>다소 서구적인 이미지이기 때문에 털털한 느낌의 심플한 차림이나 정장 등 어떤 옷이든 잘 맞<BR>는 편입니다. ', 'M40', '120');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 길쭉한 얼굴형이며 오행의 목형(木形)에 <BR>해당하는 관상입니다. <BR><BR>전체적으로 갸름하며 눈이 큰 편입니다. 콧등은 낮은<BR>편이지만 이마가 반듯하여 코가 높아 보이는 느낌이며<BR>입술이 얇습니다. <BR><BR>비교적 적당한 체형에 키는 보통이 약간 넘는 고상한 <BR>느낌을 주며 패션 감각이 뛰어나 귀공자 같은 이미지<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 를 연출하는 편입니다. ', 'M41', '121');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '대체적으로 통통해 보이는 타입입니다. 오행의 관점으<BR>로 보면 수형(水形)에 속하는 관상의 소유자입니다. <BR><BR>편안한 느낌의 인상의 호남이며 윤기 나는 피부는 나<BR>이를 짐작하기 어려운 부분이 될 것입니다. <BR><BR>전반적으로 귀여운 이미지를 보이며 키는 약간 작은 <BR>편이지만 체격은 야무진 타입입니다. ', 'M42', '122');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '통통해 보이며 전반적으로 둥근 형태의 얼굴로 오행의<BR>관점으로 보면 전형적인 수형(水形)의 얼굴입니다. <BR><BR>얼굴선이 뚜렷하며 하단부가 잘 발달되어 있는 여유로<BR>운 인상의 소유자이며 코가 크고 살집이 좋아 복 붙어<BR>있는 상입니다. <BR><BR>체격은 약간 왜소한 편이지만 탄탄한 몸매가 이를 뒷<BR>받침하고 있겠습니다. ', 'M43', '123');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '목형(木形)에 속하는 외모로 전체적으로 이지적인 느<BR>낌을 주는 얼굴입니다. <BR><BR>얼굴은 다소 길쭉한 편이며 피부가 깨끗하여 고상한 <BR>느낌을 주는 편입니다. <BR><BR>표정은 항상 차분하며 담담하기 때문에 주변 사람으로<BR>하여금 안정된 느낌을 주로 어필한다고 볼 수 있습니<BR>다. 체형은 얼굴과 비례해서 대체적으로 큰 편이며 체<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 구가 단단하고 마른 몸을 지녔습니다. ', 'M44', '124');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '관상학적 기준으로 수형(水形)에 속하기 때문에 얼굴<BR>은 전반적으로 작은 편이지만 뺨과 턱이 넉넉한 느낌<BR>을 주는 사람입니다. <BR><BR>눈썹은 진하며 날카로운 면이 느껴지며 턱은 좁고 뾰<BR>족한 느낌을 줍니다. <BR><BR>어깨는 약간 좁고 키는 크지 않겠으며 체형은 군살 없<BR>이 균형이 잘 잡혀 있는 타입입니다. 전체적으로 어리<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;고 귀여운 이미지를 느낄 수 있겠습니다. ', 'M45', '125');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류에 따르면 작은 얼굴에 하단부가 좁고 눈<BR>매가 강하므로 화형(火形)에 속한다고 볼 수 있겠습니<BR>다. <BR><BR>불이 타오르는 듯한 열정을 가진 얼굴입니다. 신뢰감<BR>이 가는 인상의 소유자이며 이목구비가 뚜렷해 웃는 <BR>모습이 매력적인 사람으로 키가 큰 편이며 