속하는 관상의 소유<BR>자로써 광대아래 부분이 넓은 편입니다.<BR>&nbsp;<BR>다소 해학적인 형태를 갖추고 있으며 턱과 함께 입이 <BR>시원스럽게 큰 편입니다. <BR><BR>주변의 여러 사람을 편하게 만들어 주는 타입입니다. <BR>체격은 보통 키에 탄탄한 몸매로 운동신경이 좋은 사<BR>람입니다. ', 'M54', '134');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전체적인 선이 둥근 편이며 안정감이 잘 살아 있는 얼<BR>굴입니다. 오행의 분류에 따르면 토형(土形) 속하는 관<BR>상의 소유자입니다. <BR><BR>눈은 작은 편이지만 전반적인 이목구비가 조화로운 호<BR>남 형이라 볼 수 있습니다. <BR><BR>적당히 큰 키에 딱 벌어진 어깨와 넉넉해 보이는 인상<BR>이 남성답다고 느낄만합니다. ', 'M55', '135');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류로 보면 그의 얼굴은 전반적으로 각이 잘 <BR>살아 있는 금형(金形)에 속하는 관상의 소유자입니다. <BR><BR>부리부리한 눈매와 굳게 다문 입술에서 볼 때에 다부<BR>진 인상의 소유자임을 느낄 수 있습니다. <BR><BR>전반적으로 강렬한 인상이며 적당한 키에 다부진 체격<BR>입니다. ', 'M56', '136');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '다소 길쭉한 느낌에 갸름한 얼굴형을 가진 사람이며 <BR>오행의 분류로 보면 목형(木形)에 해당하는 관상의 소<BR>유자입니다. <BR><BR>전반적으로 윤곽이 선명한 만큼 날카로워 보이지만 눈<BR>매가 부드럽기 때문에 서글서글한 이미지도 잘 살아난<BR>다고 볼 수 있습니다. <BR><BR>키는 큰 편이며 다소 마른 체형입니다. ', 'M57', '137');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전체적으로 화려해 보이는 느낌입니다. <BR><BR>자신의 존재감을 드러내는 강렬한 눈빛에 좁고 갸름한<BR>얼굴 형태로 비추어 오행의 분류상 전형적인 화형(火<BR>形)에 해당되는 관상의 소유자입니다. <BR><BR>대체적으로 동안이며 날카로운 라인의 턱을 형성하고 <BR>있으므로 약간은 여성스러운 이미지를 느낄 수 있겠습<BR>니다. 적당한 키에 다소 마른 체형을 가졌습니다. ', 'M58', '138');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '길고 곧은 인상으로 오행의 목형(木形)에 속하는 관상<BR>입니다. <BR><BR>전체적으로 부드러운 인상에 코가 큰 편이기 때문에 <BR>얼굴의 입체감이 잘 살아나는 편이며 군데군데 잡힌 <BR>살집이 있어 온순한 느낌을 주는 남성으로 보입니다. <BR><BR>키가 큰 편이며 몸매는 균형이 잘 잡힌 스타일입니다. ', 'M59', '139');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '길쭉한 느낌의 이지적인 인상의 소유자로 오행의 분류<BR>상 목형(木形)에 속하는 관상입니다. <BR><BR>눈은 대체적으로 작지만 나머지 코나 입은 큰 편이라 <BR>볼 수 있습니다. <BR><BR>목이 짧고 어깨가 벌어진 타입이라 시원스러운 남성적<BR>분위기가 강한 편이며 키는 약간 크거나 보통이겠으며<BR>약간의 살집과 덩치가 있어 듬직한 이미지입니다. ', 'M60', '140');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 편안하고 넉넉한 인상으로 얼굴 하단이 넓<BR>은 편으로써 오행의 분류상 수형(水形)에 해당되는 관<BR>상의 소유자입니다. <BR><BR>표정이 풍부하기 때문에 만화 캐릭터 같은 구석이 있<BR>으며 여유로워 보이는 얼굴을 하고 있습니다. 보통 키<BR>에 체격은 덩치가 꽤 된다고 볼 수 있습니다. ', 'M61', '141');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전체적으로 길고 갸름한 형태의 얼굴로 이지적인 느낌<BR>이 강합니다. 오행의 분류상 목형에 (木形) 속하는 관<BR>상의 소유자입니다. <BR><BR>길면서 점잖아 보이는 상으로 이목구비가 뚜렷하며 다<BR>소 각이 있는 인상이라 약간 보수적인 느낌을 연출합<BR>니다. 키가 큰 편이며 체구는 약간 마른 편이겠습니다. <BR>', 'M62', '142');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '흰&nbsp;피부에 얼굴의 중단부위에 적당히 살집이 잡혀 있<BR>어 둥근 느낌을 형성하고 있는 모습입니다. 오행의 분<BR>류에 따라 토형(土形)에 속하는 관상의 소유자입니다. <BR><BR>피부가 희고 오관이 뚜렷하기 때문에 서구적인 인상이<BR>느껴지겠으며 실제로 혼혈이거나 외국인일 수도 있습<BR>니다.&nbsp;키가 큰 편이며 보통의 체형이라 볼 수 있겠습니<BR>다. ', 'M63', '143');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 둥근 얼굴의 형태로써 오행의 분류에 따라<BR>토형(土形)에 해당되는 관상의 소유자입니다. <BR><BR>볼륨감이 잘 살아있는 얼굴형이기 때문에 만화캐릭터 <BR>같은 느낌을 주는 사람입니다. <BR><BR>편안한 인상에 털털한 이미지로 인해 부담스럽지 않으<BR>며 큰 키에 적당한 덩치의 호남 형으로 보입니다. ', 'M64', '144');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '길쭉한 느낌의 얼굴 형태와 깊어 보이는 눈매의 소유<BR>자로써 오행의 분류상 목형(木形)에 속하는 관상입니<BR>다. <BR><BR>전반적인 분위기는 강인해 보이겠으며 눈은 작으면서<BR>도 또렷한 전형적인 동양적 외모라 볼 수 있습니다. <BR><BR>키는 약간 큰 편에 탄탄한 몸매로써 개성이 강한 스타<BR>일의 남성이겠습니다. ', 'M65', '145');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전반적으로 둥근 얼굴의 형태로써 오행의 분류에 따라<BR>토형(土形)에 해당되는 관상의 소유자입니다. <BR><BR>여성스러운 눈매와 동양적인 이미지의 이목구비에 반<BR>듯한 얼굴형태를 하고 있으므로 미남이라 볼 수 있습<BR>니다. <BR><BR>키는 약간 작거나 보통이며 약간 마른 몸을 가졌을 것<BR>입니다. ', 'M66', '146');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '대체적으로 편안한 인상이며 얼굴 아랫부분이 넓은 여<BR>유감이 있으므로 오행의 분류상 수형(水形)에 해당하<BR>는 관상의 소유자입니다. <BR><BR>눈은 작은 편이지만 눈웃음을 잘 치거나 표정이 풍부<BR>하며 약간 검은 피부에 이목구비가 개성이 강하므로 <BR>만화캐릭터 같은 귀여움이 느껴집니다.<BR><BR>키는 작지만 체격은 좋은 편에 속하겠습니다. ', 'M67', '147');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전체적으로 길고 갸름한 형태의 얼굴로 이지적인 느낌<BR>이 강합니다. <BR><BR>오행의 분류상 목형에 (木形) 속하는 관상의 소유자입<BR>니다. 콧날이 높으며 눈은 약간 큰 편입니다. <BR><BR>표정의 변화가 풍부하고 매력적인 미소의 소유자입니<BR>다. 겉보기에 약간 마른 듯한 체형이지만 운동을 좋아<BR>하여 다부진 몸매를 가졌습니다. ', 'M68', '148');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '오행의 분류상 토형(土形)에 해당되는 관상의 소유자<BR>입니다. <BR><BR>부드러워 보이는 이목구비에 코가 큰 편이어서 복이 <BR>있는 관상입니다. <BR><BR>피부가 좋은 편이기 때문에 나이에 비해 동안입니다. <BR>키가 크고 적절히 균형 잡힌 몸매로 섹시한 매력이 느<BR>껴집니다. ', 'M69', '149');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '역 삼각의 갸름한 얼굴에 턱이 좁고 입술이 작고 얇은 <BR>전형적인 화형(火形)의 관상의 소유자입니다. <BR><BR>선명하게 찢어진 눈매와 동양적인 형태의 얼굴이 개성<BR>을 한껏 담아내며 얼굴선은 의외로 여성스럽지만 이목<BR>구비가 뚜렷하여 남성적인 이미지이므로 미남에 속한<BR>다고 볼 수 있겠습니다. ', 'M70', '150');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '전체적인 윤곽이나 코가 동글동글한 느낌을 주며 둥근<BR>얼굴 형태로 미루어 오행의 분류상 토형(土形)에 해당<BR>되는 관상의 소유자입니다. <BR><BR>얼굴형태의 특징으로는 코가 크고 둥글기 때문에 복이<BR>있는 관상이며 약간의 울림이 느껴지는 목소리에 키가<BR>큰 편이므로 여성들로부터 인기가 예상되는 스타일입<BR>니다. ', 'M71', '151');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '길쭉한 느낌의 얼굴 형태와 깊어 보이는 눈매의 소유<BR>자로써 오행의 분류상 목형(木形)에 속하는 관상입니<BR>다. <BR><BR>긴 얼굴이라는 특징에서 보이는 무게감과는 달리 얼굴<BR>전체에 볼륨감이 있는 편이기 때문에 편안한 인상으로<BR>중화되어 보입니다. <BR><BR>적당한 키에 군살이 없는 스마트한 체형이라 할 수 있<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 습니다. ', 'M72', '152');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '대체적으로 편안한 인상이며 얼굴 아랫부분이 널찍한 <BR>여유감이 있으므로 오행의 분류상 수형(水形)에 해당<BR>하는 관상의 소유자입니다. <BR><BR>그을린 듯한 검은 피부에 코가 큰 편이면서 입술이 도<BR>톰하기 때문에 은근한 매력을 느낄 수 있으며 큰 키에 <BR>탄탄한 몸매를 가진 남성이겠습니다. ', 'M73', '153');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '얼굴이 다소 긴 편이며 턱이 좁은 편이지만 전체적인 <BR>균형으로 보면 오행의 목형(木形)에 해당되는 관상입<BR>니다. <BR><BR>이목구비가 적절히 조화로우며 쌍꺼풀이 살짝 있는 편<BR>이라 세련된 분위기이며 지혜로운 이미지를 어필하는 <BR>얼굴입니다. <BR><BR>키는 매우 큰 편이며 몸매는 모델처럼 스마트한 타입<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 이라 볼 수 있습니다. ', 'M74', '154');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '이마가 넓은 반면에 턱이 좁고 갸름한 역삼각형으로 <BR>오행의 분류로 보면 전형적인 화형(火形) 관상의 소유<BR>자입니다. <BR><BR>눈썹이 진하고 이목구비가 뚜렷하여 강해보이지만 전<BR>체적으로 털털해 보이는 분위기 때문에 편안한 인상입<BR>니다. 보통 키에 적당한 체구의 남성이겠습니다. ', 'M75', '155');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '편안한 인상에 얼굴의 하단부가 넓은 편이므로 오행의<BR>분류상 수형(水形)에 해당되는 관상의 소유자입니다. <BR><BR>둥글고 여유롭게 생긴 이미지에 목소리도 차분함을 느<BR>낄 수 있으며 성격도 풍기는 이미지와 크게 다르지 않<BR>을 것 입니다. <BR><BR>적당한 키에 어느 정도 적당한 덩치가 있는 편입니다. ', 'M76', '156');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '약간 길어 보이지만 중단부위가 살집이 있어 둥근 인<BR>상을 형성하고 있으므로 오행의 분류상 토형(土形)에 <BR>해당되는 관상의 소유자입니다. <BR><BR>작고 검은 눈동자의 동양적인 이목구비에 입술이 작은<BR>편이므로 예민해 보이는 이미지에 키가 크고 표준적인<BR>체형이므로 운동신경이 잘 발달한 타입이라 볼 수 있<BR>습니다. ', 'M77', '157');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '단단해 보이는 얼굴형에 각이 잘 잡혀 있으며 오관이 <BR>뚜렷하므로 오행의 관점에서 보면 금형(金形)의 관상<BR>입니다. <BR><BR>강한 턱에서는 카리스마를 엿볼 수 있으며 전반적인 <BR>이미지가 확실한 편이기 때문에 첫 인상에서도 개성이<BR>강한 사람임이 느껴집니다. <BR><BR>적당한 키에 균형 잡힌 몸매를 갖춘 남성입니다. ', 'M78', '158');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '다소 길어 보이는 얼굴에 하단부위가 널찍한 편이므로<BR>오행의 분류에 따라 수형(水形)에 해당되는 관상의 소<BR>유자입니다. <BR><BR>강인한 턱에서는 인생의 후반부에 여유로움이 있을 상<BR>임을 나타내며 짙은 모발에서 강한 끈기를 엿볼 수 있<BR>겠습니다. <BR><BR>키는 꽤 큰 편이며 체형은 약간 마른 편으로 섹시한 매<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;력의 남성입니다. ', 'M79', '159');insert into G004(DB_check, DB_data, DB_express, DB_num) values('N', '길쭉한 느낌의 얼굴 형태와 깊어 보이는 눈매의 소유<BR>자로써 얼굴의 하단부위가 잘 발달한 모양이므로 오행<BR>의 분류상 수형(水形)에 속하는 관상입니다. <BR><BR>얼굴은 체격에 비해 약간 작은 편인데도 꽤 키가 크기 <BR>때문에 실제 키보다 더 커 보입니다. <BR><BR>건장한 덩치의 소유자이므로 부드러움과 남성다운 면<BR>을 동시에 가진 타입으로 볼 수 있습니다. ', 'M80', '160');